import './styles.css';

const ButtonSearch = () => {
  return (
    <>
      <div className="search-container">
        <div className="btn-container">
          <h6>BUSCAR</h6>
        </div>
        <button className="btn-search">
          <h6>BUSCAR</h6>
        </button>
      </div>
    </>
  );
};

export default ButtonSearch;
